import React, { useEffect, useState } from "react";
import { Container, Typography, Card, CardContent, Avatar, Table, TableBody, TableCell, TableHead, TableRow, Button } from "@mui/material";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const ProfilePage = () => {
  const [user, setUser] = useState(null);
  const [activities, setActivities] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login"); // Redirect if not logged in
      return;
    }

    axios
      .get("http://localhost:8080/api/user/profile", { headers: { Authorization: `Bearer ${token}` } })
      .then((res) => setUser(res.data))
      .catch(() => navigate("/login")); // Redirect if unauthorized

    axios
      .get("http://localhost:8080/api/user/recent-activities", { headers: { Authorization: `Bearer ${token}` } })
      .then((res) => setActivities(res.data))
      .catch((err) => console.log(err));
  }, [navigate]);

  if (!user) return <Typography>Loading...</Typography>;

  return (
    <Container>
      <Card sx={{ mt: 5 }}>
        <CardContent>
          <Typography variant="h5">Profile: {user.name}</Typography>
          <Avatar sx={{ width: 80, height: 80, mt: 2 }}>{user.name[0]}</Avatar>
          <Typography variant="h6">{user.username}</Typography>
          <Typography color="textSecondary">{user.role}</Typography>
        </CardContent>
      </Card>

      <Card sx={{ mt: 3 }}>
        <CardContent>
          <Typography variant="h6">Personal Details</Typography>
          <Typography>Name: {user.name}</Typography>
          <Typography>Email: {user.email}</Typography>
          <Typography>DOB: {user.dob}</Typography>
        </CardContent>
      </Card>

      <Card sx={{ mt: 3 }}>
        <CardContent>
          <Typography variant="h6">Recent Activities</Typography>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>#</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Time</TableCell>
                <TableCell>IP</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {activities.map((activity, index) => (
                <TableRow key={index}>
                  <TableCell>{index + 1}</TableCell>
                  <TableCell>{activity.type}</TableCell>
                  <TableCell>{activity.time}</TableCell>
                  <TableCell>{activity.ip}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </CardContent>
      </Card>

      <Button sx={{ mt: 3 }} color="error" variant="contained" onClick={() => { localStorage.removeItem("token"); navigate("/login"); }}>
        Logout
      </Button>
    </Container>
  );
};

export default ProfilePage;
